import React from "react";

const Navbar = () => {
  return (
    <nav className="flex justify-between items-center py-4 px-8 bg-white shadow">
      <div className="text-2xl font-bold flex items-center gap-2">
        <img src="/logo.png" alt="logo" className="w-8 h-8" />
        <span>THAI SIGN</span>
      </div>
      <ul className="flex gap-6">
        <li><a href="/" className="hover:text-blue-500">หน้าแรก</a></li>
        <li><a href="/lessons" className="hover:text-blue-500">บทเรียน</a></li>
        <li><a href="/practice" className="hover:text-blue-500">แบบฝึกหัด</a></li>
      </ul>
      <button className="bg-blue-600 text-white px-4 py-2 rounded-lg hover:bg-blue-700">
        Get Start
      </button>
    </nav>
  );
};

export default Navbar;
